  /*
   * Force core to be '0'. Not meaningful for Petra
   */
  int core = 0 ;

  UI_MACROS_INIT_FUNCTION("ui_petra_api_end2end_scheduler");
  soc_sand_proc_name = "soc_petra_sch_aggregate_set";

  unit = soc_petra_get_default_unit();
