/********************************************************************
 *  Function handler: mult_ing_group_open (section multicast_ingress)
 ********************************************************************/
int
  ui_petra_api_multicast_ingress_mult_ing_group_open_or_update(
    CURRENT_LINE *current_line
  )
{
  uint32
    ret = 0;
  SOC_PETRA_MULT_ID
    prm_up_to_multicast_id_ndx,
    prm_multicast_id_ndx = 0;
  SOC_PETRA_MULT_ING_ENTRY
    first_mc_group,
    up_to_mc_group;

  UI_MACROS_INIT_FUNCTION("ui_petra_api_multicast_ingress");
  soc_sand_proc_name = "soc_petra_mult_ing_group_open";

  unit = soc_petra_get_default_unit();
  soc_petra_PETRA_MULT_ING_ENTRY_clear(&first_mc_group);
  soc_petra_PETRA_MULT_ING_ENTRY_clear(&up_to_mc_group);

  /* Get parameters */
  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_MULT_ING_GROUP_OPEN_MULT_ING_GROUP_OPEN_MULTICAST_ID_NDX_ID,1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_PETRA_MULT_ING_GROUP_OPEN_MULT_ING_GROUP_OPEN_MULTICAST_ID_NDX_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    prm_multicast_id_ndx = (SOC_PETRA_MULT_ID)param_val->value.ulong_value;
  }
  else
  {
    send_string_to_screen(" *** SW error - expecting parameter multicast_id_ndx after mult_ing_group_open***", TRUE);
    goto exit;
  }
  prm_up_to_multicast_id_ndx = prm_multicast_id_ndx;
  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_MULT_ING_GROUP_OPEN_MULT_ING_GROUP_OPEN_UP_TO_MULTICAST_ID_NDX_ID,1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_PETRA_MULT_ING_GROUP_OPEN_MULT_ING_GROUP_OPEN_UP_TO_MULTICAST_ID_NDX_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    prm_up_to_multicast_id_ndx = (SOC_PETRA_MULT_ID)param_val->value.ulong_value;
  }
  if(prm_up_to_multicast_id_ndx < prm_multicast_id_ndx)
  {
    prm_up_to_multicast_id_ndx = prm_multicast_id_ndx;
  }

  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_MULT_ING_GROUP_OPEN_MULT_ING_GROUP_OPEN_MC_GROUP_OUTLIF_ID,1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_PETRA_MULT_ING_GROUP_OPEN_MULT_ING_GROUP_OPEN_MC_GROUP_OUTLIF_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    first_mc_group.cud = (uint32)param_val->value.ulong_value;
  }

  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_MULT_ING_GROUP_OPEN_MULT_ING_GROUP_OPEN_MC_GROUP_DESTINATION_ID_ID,1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_PETRA_MULT_ING_GROUP_OPEN_MULT_ING_GROUP_OPEN_MC_GROUP_DESTINATION_ID_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    first_mc_group.destination.id = (uint32)param_val->value.ulong_value;
  }

  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_MULT_ING_GROUP_OPEN_MULT_ING_GROUP_OPEN_MC_GROUP_DESTINATION_TYPE_ID,1))
  {
    UI_MACROS_GET_SYMBOL_VAL(PARAM_PETRA_MULT_ING_GROUP_OPEN_MULT_ING_GROUP_OPEN_MC_GROUP_DESTINATION_TYPE_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    first_mc_group.destination.type = param_val->numeric_equivalent;
  }


  up_to_mc_group.cud           = first_mc_group.cud;
  up_to_mc_group.destination.id   = first_mc_group.destination.id;
  up_to_mc_group.destination.type = first_mc_group.destination.type;

  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_MULT_ING_GROUP_OPEN_MULT_ING_GROUP_OPEN_MC_GROUP_UP_TO_OUTLIF_ID,1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_PETRA_MULT_ING_GROUP_OPEN_MULT_ING_GROUP_OPEN_MC_GROUP_UP_TO_OUTLIF_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    up_to_mc_group.cud = (uint32)param_val->value.ulong_value;
  }

  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_MULT_ING_GROUP_OPEN_MULT_ING_GROUP_OPEN_MC_GROUP_UP_TO_DESTINATION_ID_ID,1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_PETRA_MULT_ING_GROUP_OPEN_MULT_ING_GROUP_OPEN_MC_GROUP_UP_TO_DESTINATION_ID_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    up_to_mc_group.destination.id = (uint32)param_val->value.ulong_value;
  }
  for(;prm_multicast_id_ndx<=prm_up_to_multicast_id_ndx;prm_multicast_id_ndx++)
  {
#ifndef __DUNE_SSF__
    if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_MULT_ING_GROUP_UPDATE_MULT_ING_GROUP_UPDATE_ID,1))
    {
      soc_sand_os_printf( "*** ERROR: depends on sweep code. Not in BCM\n\r");
      ret = SOC_SAND_ERR;
    }
    else
    {
      soc_sand_os_printf( "*** ERROR: depends on sweep code. Not in BCM\n\r");
      ret = SOC_SAND_ERR;
    }
 #endif
  }



  goto exit;
exit:
  return ret;
}

