/********************************************************************
 *  Function handler: srd_eye_scan_run (section serdes_utils)
 ********************************************************************/
int
  ui_petra_api_serdes_utils_srd_eye_scan_run(
    CURRENT_LINE *current_line
  )
{
  uint32
    ret;
  uint32
    indx,
    prm_nof_lane_index=0;
  SOC_PETRA_SRD_EYE_SCAN_INFO
    prm_info;
  uint32
    res_i;
  SOC_PETRA_SRD_EYE_SCAN_RES
    *prm_res = NULL;
  SOC_PETRA_SRD_CNT_SRC
    counting_src = SOC_PETRA_SRD_NOF_CNT_SRCS;
  SOC_PETRA_SRD_TRAFFIC_SRC
    traffic_src = SOC_PETRA_SRD_NOF_TRAFFIC_SRCS;

  UI_MACROS_INIT_FUNCTION("ui_petra_api_serdes_utils");
  soc_sand_proc_name = "soc_petra_srd_eye_scan_run";

  unit = soc_petra_get_default_unit();
  soc_petra_PETRA_SRD_EYE_SCAN_INFO_clear(&prm_info);

  /* Get parameters */
  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_SRD_EYE_SCAN_RUN_SRD_EYE_SCAN_RUN_INFO_TRAFFIC_SRC_ID,1))
  {
    UI_MACROS_GET_NUM_SYM_VAL(PARAM_PETRA_SRD_EYE_SCAN_RUN_SRD_EYE_SCAN_RUN_INFO_TRAFFIC_SRC_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    UI_MACROS_LOAD_LONG_VAL(traffic_src);
  }
  prm_info.traffic_src = traffic_src;
  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_SRD_EYE_SCAN_RUN_SRD_EYE_SCAN_RUN_INFO_RESOLUTION_ID,1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_PETRA_SRD_EYE_SCAN_RUN_SRD_EYE_SCAN_RUN_INFO_RESOLUTION_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    prm_info.resolution = (uint32)param_val->value.ulong_value;
  }

  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_SRD_EYE_SCAN_RUN_SRD_EYE_SCAN_RUN_INFO_TX_PRBS_ID,1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_PETRA_SRD_EYE_SCAN_RUN_SRD_EYE_SCAN_RUN_INFO_TX_PRBS_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    prm_info.params.prbs.is_tx_prbs_enabled = (uint32)param_val->value.ulong_value;
  }

  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_SRD_EYE_SCAN_RUN_SRD_EYE_SCAN_RUN_INFO_PRBS_DURATION_MIN_SEC_ID,1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_PETRA_SRD_EYE_SCAN_RUN_SRD_EYE_SCAN_RUN_INFO_PRBS_DURATION_MIN_SEC_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    prm_info.duration_min_sec = (uint32)param_val->value.ulong_value;
  }

  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_SRD_EYE_SCAN_RUN_SRD_EYE_SCAN_RUN_INFO_LANE_NDX_ID,1))
  {
    for (prm_nof_lane_index = 0; prm_nof_lane_index < SOC_PETRA_SRD_NOF_LANES; ++prm_nof_lane_index, ui_ret = 0)
    {
      UI_MACROS_GET_NUM_SYM_VAL_WITH_INDEX(PARAM_PETRA_SRD_EYE_SCAN_RUN_SRD_EYE_SCAN_RUN_INFO_LANE_NDX_ID, prm_nof_lane_index + 1);
      if (ui_ret)
      {
        ui_ret = 0;
        break;
      }
      UI_MACROS_LOAD_LONG_VAL(prm_info.lane_ndx[prm_nof_lane_index]);

      /*
       *  If the option 'all' links has been chosen
       */
      if (prm_info.lane_ndx[prm_nof_lane_index] == SOC_PETRA_SRD_NOF_LANES)
      {
        for (indx = 0; indx < SOC_PETRA_SRD_NOF_LANES; ++indx)
        {
          prm_info.lane_ndx[indx] = indx;
          prm_nof_lane_index = SOC_PETRA_SRD_NOF_LANES;
        }
        break;
      }

    }
  }

  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_SRD_EYE_SCAN_RUN_SRD_EYE_SCAN_RUN_INFO_CRC_ID,1))
  {
    UI_MACROS_GET_NUM_SYM_VAL(PARAM_PETRA_SRD_EYE_SCAN_RUN_SRD_EYE_SCAN_RUN_INFO_CRC_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    UI_MACROS_LOAD_LONG_VAL(counting_src);
  }
  if (traffic_src == SOC_PETRA_SRD_TRAFFIC_SRC_PRBS)
  {
    prm_info.params.prbs.cnt_src = counting_src;
  }
  else
  {
    prm_info.params.ext.cnt_src = counting_src;
  }

  prm_info.nof_lane_ndx_entries = prm_nof_lane_index;

  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_SRD_EYE_SCAN_RUN_SRD_EYE_SCAN_RUN_INFO_MODE_ID,1))
  {
    UI_MACROS_GET_SYMBOL_VAL(PARAM_PETRA_SRD_EYE_SCAN_RUN_SRD_EYE_SCAN_RUN_INFO_MODE_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    prm_info.params.prbs.mode = param_val->numeric_equivalent;
  }


  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_SRD_EYE_SCAN_RUN_SRD_EYE_SCAN_RUN_INFO_RANGE_DFELTH_MAX_ID,1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_PETRA_SRD_EYE_SCAN_RUN_SRD_EYE_SCAN_RUN_INFO_RANGE_DFELTH_MAX_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    prm_info.range.dfelth_max = (uint8)param_val->value.ulong_value;
  }

  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_SRD_EYE_SCAN_RUN_SRD_EYE_SCAN_RUN_INFO_RANGE_DFELTH_MIN_ID,1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_PETRA_SRD_EYE_SCAN_RUN_SRD_EYE_SCAN_RUN_INFO_RANGE_DFELTH_MIN_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    prm_info.range.dfelth_min = (uint8)param_val->value.ulong_value;
  }

  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_SRD_EYE_SCAN_RUN_SRD_EYE_SCAN_RUN_INFO_RANGE_TLTH_MAX_ID,1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_PETRA_SRD_EYE_SCAN_RUN_SRD_EYE_SCAN_RUN_INFO_RANGE_TLTH_MAX_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    prm_info.range.tlth_max = (uint8)param_val->value.ulong_value;
  }

  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_SRD_EYE_SCAN_RUN_SRD_EYE_SCAN_RUN_INFO_RANGE_TLTH_MIN_ID,1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_PETRA_SRD_EYE_SCAN_RUN_SRD_EYE_SCAN_RUN_INFO_RANGE_TLTH_MIN_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    prm_info.range.tlth_min = (uint8)param_val->value.ulong_value;
  }

  /* allocate result structures */
  prm_res = sal_alloc(sizeof(SOC_PETRA_SRD_EYE_SCAN_RES) * prm_info.nof_lane_ndx_entries, "prm_res");
  if (!prm_res)
  {
    send_string_to_screen(" *** sal_alloc_any_size - FAIL", TRUE);
    goto exit;
  }


  for (res_i = 0; res_i < prm_info.nof_lane_ndx_entries; res_i++)
  {
    soc_petra_PETRA_SRD_EYE_SCAN_RES_clear(&(prm_res[res_i]));
  }

  /* Call function */

  ret = soc_petra_srd_eye_scan_run(
          unit,
          &prm_info,
          FALSE,
          prm_res
        );
  if (soc_sand_get_error_code_from_error_word(ret) != SOC_SAND_OK)
  {
    send_string_to_screen(" *** soc_petra_srd_eye_scan_run - FAIL", TRUE);
    soc_petra_disp_result(ret, "soc_petra_srd_eye_scan_run");
    goto exit;
  }

  send_string_to_screen("--> res:", TRUE);

  for (res_i = 0; res_i < prm_info.nof_lane_ndx_entries; res_i++)
  {
    SOC_PETRA_SRD_RX_PHYS_INTERNAL_PARAMS
      rx_phys_internal_params;

    soc_petra_PETRA_SRD_RX_PHYS_INTERNAL_PARAMS_clear(&rx_phys_internal_params);

    ret = soc_petra_srd_rx_phys_params_get(
            unit,
            prm_info.lane_ndx[res_i],
            &rx_phys_internal_params);
    if (soc_sand_get_error_code_from_error_word(ret) != SOC_SAND_OK)
    {
      send_string_to_screen(" *** soc_petra_srd_rx_phys_params_get - FAIL", TRUE);
      soc_petra_disp_result(ret, "soc_petra_srd_rx_phys_params_get");
      goto exit;
    }

    soc_sand_os_printf( "Lane %d:\n\r", prm_info.lane_ndx[res_i]);
    soc_petra_PETRA_SRD_EYE_SCAN_RES_print(&prm_res[res_i]);
    rx_phys_internal_params.tlth = prm_res[res_i].optimum.tlth;
    rx_phys_internal_params.dfelth = prm_res[res_i].optimum.dfelth;
    soc_petra_PETRA_SRD_RX_PHYS_INTERNAL_PARAMS_print(&rx_phys_internal_params);
    soc_sand_os_printf( "\n\r");
  }

  goto exit;
exit:
  sal_free(prm_res);
  return ui_ret;
}
