/********************************************************************
 *  Function handler: fc_enable_set (section fabric)
 ********************************************************************/
int
  ui_petra_api_fabric_fc_enable_set(
    CURRENT_LINE *current_line
  )
{
  uint32
    ret = 0;
  SOC_PETRA_CONNECTION_DIRECTION
    prm_direction_ndx = SOC_PETRA_CONNECTION_DIRECTION_BOTH;
  uint32
    prm_enable_index = 0xFFFFFFFF;
  SOC_PETRA_FABRIC_FC
    prm_rx_info,
    prm_tx_info;

  UI_MACROS_INIT_FUNCTION("ui_petra_api_fabric");
  soc_sand_proc_name = "soc_petra_fabric_fc_enable_set";

  unit = soc_petra_get_default_unit();
  soc_petra_PETRA_FABRIC_FC_clear(unit, &prm_rx_info);
  soc_petra_PETRA_FABRIC_FC_clear(unit, &prm_tx_info);

  /* Get parameters */
  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_FABRIC_FC_ENABLE_SET_FC_ENABLE_SET_DIRECTION_NDX_ID,1))
  {
    UI_MACROS_GET_SYMBOL_VAL(PARAM_PETRA_FABRIC_FC_ENABLE_SET_FC_ENABLE_SET_DIRECTION_NDX_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    prm_direction_ndx = param_val->numeric_equivalent;
  }


  /* This is a set function, so call GET function first */
  ret = soc_petra_fabric_fc_enable_get(
          unit,
          &prm_rx_info,
          &prm_tx_info
        );
  if (soc_sand_get_error_code_from_error_word(ret) != SOC_SAND_OK)
  {
    soc_petra_disp_result(ret, "soc_petra_fabric_fc_enable_get");
    goto exit;
  }

  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_FABRIC_FC_ENABLE_SET_FC_ENABLE_SET_INFO_ENABLE_INDEX_ID,1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_PETRA_FABRIC_FC_ENABLE_SET_FC_ENABLE_SET_INFO_ENABLE_INDEX_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    prm_enable_index = (uint32)param_val->value.ulong_value;
  }

  if(prm_enable_index != 0xFFFFFFFF)
  {

    if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_FABRIC_FC_ENABLE_SET_FC_ENABLE_SET_INFO_ENABLE_ID,1))
    {
      UI_MACROS_GET_NUMMERIC_VAL(PARAM_PETRA_FABRIC_FC_ENABLE_SET_FC_ENABLE_SET_INFO_ENABLE_ID);
      UI_MACROS_CHECK_GET_VAL_OF_ERROR;

      prm_rx_info.enable[ prm_enable_index] = (uint8)param_val->value.ulong_value;
      prm_tx_info.enable[ prm_enable_index] = (uint8)param_val->value.ulong_value;
    }

  }


  /* Call function */
  switch(prm_direction_ndx)
  {
  case SOC_PETRA_CONNECTION_DIRECTION_RX:
    ret = soc_petra_fabric_fc_enable_set(
            unit,
            prm_direction_ndx,
            &prm_rx_info
          );
    if (soc_sand_get_error_code_from_error_word(ret) != SOC_SAND_OK)
    {
      soc_petra_disp_result(ret, "soc_petra_fabric_fc_enable_set");
      goto exit;
    }

    break;

  case SOC_PETRA_CONNECTION_DIRECTION_TX:
    ret = soc_petra_fabric_fc_enable_set(
            unit,
            prm_direction_ndx,
            &prm_tx_info
          );
    if (soc_sand_get_error_code_from_error_word(ret) != SOC_SAND_OK)
    {
      soc_petra_disp_result(ret, "soc_petra_fabric_fc_enable_set");
      goto exit;
    }

    break;

  case SOC_PETRA_CONNECTION_DIRECTION_BOTH:
    ret = soc_petra_fabric_fc_enable_set(
            unit,
            prm_direction_ndx,
            &prm_rx_info
          );
    if (soc_sand_get_error_code_from_error_word(ret) != SOC_SAND_OK)
    {
      soc_petra_disp_result(ret, "soc_petra_fabric_fc_enable_set");
      goto exit;
    }

    ret = soc_petra_fabric_fc_enable_set(
            unit,
            prm_direction_ndx,
            &prm_tx_info
          );
    if (soc_sand_get_error_code_from_error_word(ret) != SOC_SAND_OK)
    {
      soc_petra_disp_result(ret, "soc_petra_fabric_fc_enable_set");
      goto exit;
    }

    break;

  default:
      goto exit;
  }

  goto exit;
exit:
  return ui_ret;
}

