/********************************************************************
 *  Function handler: read_reg (section reg_access)
 ********************************************************************/
int
  ui_petra_api_reg_access_read_reg(
    CURRENT_LINE *current_line
  )
{
  uint32
    ret = 0;
  SOC_PETRA_REG_FIELD
    prm_field;
  uint32
    prm_val,
    do_ndx,
    nof_occurs = 1,
    wait_time=1,
    sec[3],
    nano[3];

  UI_MACROS_INIT_FUNCTION("ui_petra_api_reg_access");
  soc_sand_proc_name = "soc_petra_read_reg";

  unit = soc_petra_get_default_unit();
  prm_field.addr.step = 0;
  prm_field.lsb = 0;
  prm_field.msb = 31;
  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_READ_REG_READ_REG_ID,1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_PETRA_READ_REG_READ_REG_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    prm_field.addr.base = (uint32)param_val->value.ulong_value;
  }

  /* Get parameters */
  prm_field.addr.base *= 4;

  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_DO_TWICE_ID, 1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_PETRA_DO_TWICE_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    nof_occurs = 2;
    wait_time = (uint32)param_val->value.ulong_value;
  }

  /* Call function */
  for(do_ndx=0;do_ndx<nof_occurs;do_ndx++)
  {
    ret = soc_petra_ui_read_fld(
            unit,
            &prm_field,
            &prm_val
          );
    if (soc_sand_get_error_code_from_error_word(ret) != SOC_SAND_OK)
    {
      soc_petra_disp_result(ret, "soc_petra_read_reg");
      goto exit;
    }

    if(nof_occurs==2)
    {
      soc_sand_os_get_time(&sec[do_ndx],&nano[do_ndx]);
      if(do_ndx == 0)
      {
        sal_msleep(wait_time);
      }
      else
      {
        soc_sand_os_get_time_diff(sec[0],nano[0],sec[1],nano[1],&sec[2],&nano[2]);
        soc_sand_os_printf( " Waited %d seconds and %d nanoseconds\n\r", sec[2],nano[2]);
      }
    }
    soc_sand_os_printf( "val: 0x%.8X\n\r",prm_val);
  }

  goto exit;
exit:
  return ui_ret;
}

