int
  ui_petra_iread(
    CURRENT_LINE *current_line
  )
{
  uint32
    addr=0,
    *data = NULL,
    ret=0,
    size=0,
    do_ndx,
    nof_occurs = 1,
    wait_time=0,
    sec[3],
    nano[3],
    module_id = 0,
    nof_entries = 1,
    i,j;

  UI_MACROS_INIT_FUNCTION("ui_petra_iread");
  soc_sand_proc_name = "ui_petra_iread";

  unit = soc_petra_get_default_unit();

  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_IRW_OFFSET_ID,1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_PETRA_IRW_OFFSET_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    addr = (uint32)param_val->value.ulong_value;
  }

  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_SIZE_ID,1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_PETRA_SIZE_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    size = (uint32)param_val->value.ulong_value;
  }

  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_DO_TWICE_ID, 1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_PETRA_DO_TWICE_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    nof_occurs = 2;
    wait_time = (uint32)param_val->value.ulong_value;
  }

  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_IACC_MODULE_ID_ID,1))
  {
    UI_MACROS_GET_SYMBOL_VAL(PARAM_PETRA_IACC_MODULE_ID_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    module_id = param_val->numeric_equivalent;
  }

  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_NOF_ENTRIES_ID, 1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_PETRA_NOF_ENTRIES_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    nof_entries = (uint32)param_val->value.ulong_value;
  }

  data = sal_alloc(size * nof_entries * sizeof(uint32), "data");
  if (!data)
  {
    send_string_to_screen(" *** sal_alloc - FAIL", TRUE);
    goto exit;
  }

  for(do_ndx=0;do_ndx<nof_occurs;do_ndx++)
  {
    ret = soc_sand_tbl_read(
      unit,
      data,
      addr,
      size * sizeof(uint32) * nof_entries,
      module_id,
      size * sizeof(uint32)
      );
    if(nof_occurs==2)
    {
      soc_sand_os_get_time(&sec[do_ndx],&nano[do_ndx]);
      if(do_ndx == 0)
      {
        sal_msleep(wait_time);
      }
      else
      {
        soc_sand_os_get_time_diff(sec[0],nano[0],sec[1],nano[1],&sec[2],&nano[2]);
        soc_sand_os_printf( " Waited %d: %d \n\r", sec[2],nano[2]);
      }
    }
    if (soc_sand_get_error_code_from_error_word(ret) != SOC_SAND_OK)
    {
      send_string_to_screen(" *** soc_sand_mem_iread - FAIL", TRUE);
      soc_petra_disp_result(ret, "soc_sand_mem_iread");
      goto exit;
    }

    for (i = 0; i < nof_entries; ++i)
    {
      soc_sand_os_printf( "addr 0x%x: ", addr+i);

      for (j = 0; j < size; ++j)
      {
        soc_sand_os_printf( "0x%x ", data[i*size + (size-j-1)]);
      }

      soc_sand_os_printf( "\n\r");
    }
  }

  goto exit;
exit:
  if (data)
  {
    sal_free(data);
  }
  return ui_ret;
}

int
  ui_petra_iwrite(
    CURRENT_LINE *current_line
  )
{
  uint32
    addr=0,
    nof_enties=1,
    indx,
    param_i,
    data[5],
    as_entry_valid = FALSE,
    ret,
    vals[5],
    size=0,
    do_ndx,
    nof_occurs = 1,
    wait_time=0,
    sec[3],
    nano[3],
    as_entry=0,
    module_id = 0;

  UI_MACROS_INIT_FUNCTION("ui_petra_iwrite");
  soc_sand_proc_name = "ui_petra_iwrite";

  unit = soc_petra_get_default_unit();

  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_IRW_OFFSET_ID,1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_PETRA_IRW_OFFSET_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    addr = (uint32)param_val->value.ulong_value;
  }

  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_DO_TWICE_ID, 1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_PETRA_DO_TWICE_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    nof_occurs = 2;
    wait_time = (uint32)param_val->value.ulong_value;
  }

  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_NOF_ENTRIES_ID, 1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_PETRA_NOF_ENTRIES_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    nof_enties = (uint32)param_val->value.ulong_value;
  }

  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_AS_ENTRY_ID, 1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_PETRA_AS_ENTRY_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    as_entry = (uint32)param_val->value.ulong_value;
    as_entry_valid = TRUE;
  }

  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_IACC_MODULE_ID_ID,1))
  {
    UI_MACROS_GET_SYMBOL_VAL(PARAM_PETRA_IACC_MODULE_ID_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    module_id = param_val->numeric_equivalent;
  }
  if(!search_param_val_pairs(current_line,&match_index,PARAM_PETRA_SIZE_ID,1))
  {
    UI_MACROS_GET_NUMMERIC_VAL(PARAM_PETRA_SIZE_ID);
    UI_MACROS_CHECK_GET_VAL_OF_ERROR;
    size = (uint32)param_val->value.ulong_value;
  }

  if (!as_entry_valid)
  {

    for (param_i=1; param_i<=5; ++param_i)
    {
      ret = search_param_val_pairs(current_line,&match_index,PARAM_PETRA_ACC_IWRITE_VAL_ID,param_i);
      if (0 != ret)
      {
        ret=0;
        break;
      }
      UI_MACROS_GET_NUMMERIC_VAL_WITH_INDEX(PARAM_PETRA_ACC_IWRITE_VAL_ID,param_i);
      UI_MACROS_CHECK_GET_VAL_OF_ERROR;
      vals[param_i-1] = param_val->value.ulong_value;
    }


    if(size == 1)
    {
      data[0] = vals[0];
    }
    else if(size == 2)
    {
      data[1] = vals[0];
      data[0] = vals[1];
    }
   else if(size == 3)
    {
      data[2] = vals[0];
      data[1] = vals[1];
      data[0] = vals[2];
    }
    else if (size == 4 || size == 5)
    {
      sal_memcpy(data,vals,size * 4);
    }
    else
    {
      soc_sand_os_printf( "size %d is invalid\n\r", size);
    }
  }
  else
  {
    for(do_ndx=0;do_ndx<nof_occurs;do_ndx++)
    {
      ret = soc_sand_tbl_read(
        unit,
        data,
        as_entry,
        size * sizeof(uint32),
        module_id,
        size * sizeof(uint32)
        );
      if(nof_occurs==2)
      {
        soc_sand_os_get_time(&sec[do_ndx],&nano[do_ndx]);
        if(do_ndx == 0)
        {
          sal_msleep(wait_time);
        }
        else
        {
          soc_sand_os_get_time_diff(sec[0],nano[0],sec[1],nano[1],&sec[2],&nano[2]);
          soc_sand_os_printf( " Waited %d: %d \n\r", sec[2],nano[2]);
        }
      }
      if (soc_sand_get_error_code_from_error_word(ret) != SOC_SAND_OK)
      {
        send_string_to_screen(" *** soc_sand_mem_iread - FAIL", TRUE);
        soc_petra_disp_result(ret, "soc_sand_mem_iread");
        goto exit;
      }
      soc_sand_os_printf( "addr 0x%x data 0x%x 0x%x 0x%x 0x%x 0x%x", addr, data[4], data[3], data[2], data[1], data[0]);
    }
  }

  for(indx=0;indx<nof_enties;indx++)
  {
    for(do_ndx=0;do_ndx<nof_occurs;do_ndx++)
    {
      ret = soc_sand_tbl_write(
        unit,
        data,
        addr+indx,
        size * sizeof(uint32),
        module_id,
        size * sizeof(uint32)
        );
      if(nof_occurs==2)
      {
        soc_sand_os_get_time(&sec[do_ndx],&nano[do_ndx]);
        if(do_ndx == 0)
        {
          sal_msleep(wait_time);
        }
        else
        {
          soc_sand_os_get_time_diff(sec[0],nano[0],sec[1],nano[1],&sec[2],&nano[2]);
          soc_sand_os_printf( " Waited %d: %d \n\r", sec[2],nano[2]);
        }
      }
      if (soc_sand_get_error_code_from_error_word(ret) != SOC_SAND_OK)
      {
        send_string_to_screen(" *** soc_sand_mem_iwrite - FAIL", TRUE);
        soc_petra_disp_result(ret, "soc_sand_mem_iwrite");
        goto exit;
      }
    }
  }


  goto exit;
exit:
  return ui_ret;
}

